#include <string.h>
#include <stdio.h>
char *bin = "\"\"";

int main(int argc, char const *argv[])
{
    int len = strlen(bin);
    for (int i = 0; i < len; i++)
    {
        if (i % 118 == 0) {
            printf("\"\n\"");
        }
        if (bin[i] == '1') {
            printf("\\xFF");
        } else {
            printf("\\x00");
        }
    }
    
    return 0;
}
